import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'

function Read() {

  const {id} = useParams();
  useEffect(() => {
    axios.get('http://localhost:8081/read/'+id)
    .then(res => console.log(res))
    .catch(err => console.log(err));
  }, [])
  return (
    <div>
      <h1>Read</h1>
    </div>
  )
}

export default Read
